const FavoritesReducer = (state = 0,action) => {
    switch(action.type){
        case 'FETCH_ALL_FAVORITE':
            return state
        case 'ADD_FAVORITE':
            return state
        case 'DELETE_FAVORITE':
            return state
        default:
            return state
    }
}

export default FavoritesReducer
